import React from 'react';
import OpcionesDd from './OpcionesDd.js'
import {datos} from './datos.js'




class MenuDN extends React.Component {
	render(){
		return(
			<div className="collapse navbar-collapse " id="navbarSupportedContent">
				<ul className="nav navbar-nav menu_nav ml-auto">
					<li className="nav-item active"><a className="nav-link" href="index.html">Inicio</a></li> 
					<OpcionesDd Title="Tienda" NameItems={datos.Tienda} NumItems={datos.Tienda.length} OnClick = {this.props.OnClick}/> 
					<OpcionesDd Title="Blog" NameItems={datos.Blog} NumItems={datos.Blog.length} OnClick = {this.props.OnClick}/> 
					<OpcionesDd Title="Perfil" NameItems={datos.Perfil.length} NumItems={datos.Perfil.length} OnClick = {this.props.OnClick}/> 
					<OpcionesDd Title="Contact"  NumItems={datos.Contact.length} OnClick = {this.props.OnClick}/> 
				</ul>
				<ul className="nav navbar-nav navbar-right">
					<li className="nav-item"><a href="#" className="cart"><i className="lnr lnr lnr-cart"></i></a></li>
					<li className="nav-item"><a href="#" className="search"><i className="lnr lnr-magnifier"></i></a></li>
				</ul>
			</div>
		)

	}
}

export default MenuDN;
